/**
 * [bossScreenKeyDownHandler description]
 * @param  {[type]} event [description]
 * @return {[type]}       [description]
 */
var bossScreenKeyDownHandler = function(event) {
	switch (event.keyCode) {
		case keyCodes.left:
			// keyCode 37 is left arrow
			bossnumber--;
			break;

		case keyCodes.right:
			// keyCode 39 is right arrow
			bossnumber++;
			break;


		case keyCodes.jump:
			// keyCode 32 is space

			document.getElementById("gamecanvas").removeEventListener("keydown", bossClickHandler, false);
			initVars();
			initShowOffBossScreen(bossNumber);
			bossScreenUp = false;
			playSound("pauseopen");
			break;
	}
};
bossScreenKeyDownHandler = bossScreenKeyDownHandler.bind(this);

/**
 * [buildSaveLoadTouchTarget description]
 * @param  {[type]} text [description]
 * @return {[type]}      [description]
 */
function buildSaveLoadTouchTarget(text) {
	var touchTarget = {};
	touchTarget.x = text.x - 5;
	touchTarget.y = text.y - 3;
	touchTarget.spriteSheet = {};
	touchTarget.spriteSheet._frameHeight = 32;
	touchTarget.spriteSheet._frameWidth = 40;
	return touchTarget;
}


function bossClickHandler(event) {
	if (!bossScreenUp) {
		return;
	}

	if (shopUp || optionsUp) {
		return;
	}

	var touchEventSpriteSheet = new createjs.SpriteSheet({
		"images": [loader.getResult("beam")],
		"frames": {
			"width": 1,
			"height": 1,
			"count": 1
		},
		"animations": {
			"exist": {
				"frames": [0],
				"next": "exist"
			}
		}
	});
	var touchSprite = new createjs.Sprite(touchEventSpriteSheet, "exist");

	event.preventDefault();

	touchSprite.x = ((event.pageX || touch.pageX)) / gamezoom - document.getElementById("gamecanvas").offsetLeft;
	touchSprite.y = (event.pageY || touch.pageY) / gamezoom;
	if (fastCollisionSprite(this.saveGameTouchTarget, touchSprite)) {
		saveGame();
		playSound("pauseopen");
	} else if (fastCollisionSprite(this.loadGameTouchTarget, touchSprite)) {
		loadGame();
		playSound("pauseopen");
	} else if (fastCollisionSprite(this.optionsMenuTouchTarget, touchSprite)) {
		this.optionsMenu.show();
	} else {
		for (var k = 0; k < frames.length; k++) {
			if (fastCollisionSprite(this.frames[k], touchSprite)) {
				initVars();
				initShowOffBossScreen(k);
				bossScreenUp = false;
				playSound("pauseopen");
				document.getElementById("gamecanvas").removeEventListener("click", bossClickHandler, false);
			}
		}
	}
}
bossClickHandler = bossClickHandler.bind(this);

/**
 * [handleBossScreenTick description]
 * @param  {[type]} event [description]
 * @return {[type]}       [description]
 */
function handleBossScreenTick(event) {
	if (bossscreenCounter > 0) {
		stage.x += gamestage.canvas.width / 60;
		altstage.x -= gamestage.canvas.width / 60;
		bossscreenCounter--;
	}

	if (startlevel) {
		initVars();
		beginGame(true);
		event.remove();
	}

	if (gamestage) {
		gamestage.update();
	}
}
/**
 * [TileCollisionDetector description]
 */
function TileCollisionDetector() {
	/**
	 * [checkCollisions description]
	 * @param  {[type]} playerCollisionPoints [description]
	 * @param  {[type]} collisionArray        [description]
	 * @param  {[type]} heightOffset          [description]
	 * @param  {[type]} widthOffset           [description]
	 * @return {[type]}                       [description]
	 */
	this.checkCollisions = function(playerCollisionPoints, collisionArray, heightOffset, widthOffset) {

		var moves = {
			leftmove: true,
			downmove: true,
			rightmove: true,
			upmove: true,
			nextmap: false,
			nextmapup: false
		};
		var tilesize = 16; // this is used as width and height!

		try {
			var a = ~~((playerCollisionPoints.leftTop.y - heightOffset) / tilesize);
			var b = ~~((playerCollisionPoints.leftTop.x - widthOffset) / tilesize);

			if (a <= -1 || a > collisionArray.length) {
				a = 0;
			}

			if (b <= -1 || b > collisionArray[a].length) {
				b = 0;
			}

			if (collisionArray[a][b]) {
				moves.leftmove = false;
			}

			a = ~~((playerCollisionPoints.leftBottom.y - heightOffset) / tilesize);
			b = ~~((playerCollisionPoints.leftBottom.x - widthOffset) / tilesize);

			if (a <= -1 || a > collisionArray.length) {
				a = 0;
			}

			if (b <= -1 || b > collisionArray[a].length) {
				b = 0;
			}

			if (collisionArray[a][b]) {
				moves.leftmove = false;
			}

			a = ~~((playerCollisionPoints.bottomLeft.y - heightOffset) / tilesize);
			b = ~~((playerCollisionPoints.bottomLeft.x - widthOffset) / tilesize);

			if (a <= -1 || a > collisionArray.length) {
				a = 0;
			}

			if (b <= -1 || b > collisionArray[a].length) {
				b = 0;
			}

			if (collisionArray[a][b] && this.isTop(collisionArray, a, b)) {
				moves.downmove = false;
			}

			a = ~~((playerCollisionPoints.bottomRight.y - heightOffset) / tilesize);
			b = ~~((playerCollisionPoints.bottomRight.x - widthOffset) / tilesize);

			if (a <= -1 || a > collisionArray.length) {
				a = 0;
			}

			if (b <= -1 || b > collisionArray[a].length) {
				b = 0;
			}

			if (collisionArray[a][b] && this.isTop(collisionArray, a, b)) {
				moves.downmove = false;
			}

			a = ~~((playerCollisionPoints.rightBottom.y - heightOffset) / tilesize);
			b = ~~((playerCollisionPoints.rightBottom.x - widthOffset) / tilesize);

			if (a <= -1 || a > collisionArray.length) {
				a = 0;
			}

			if (b <= -1 || b > collisionArray[a].length) {
				b = 0;
			}

			if (collisionArray[a][b]) {
				moves.rightmove = false;
			}

			a = ~~((playerCollisionPoints.rightTop.y - heightOffset) / tilesize);
			b = ~~((playerCollisionPoints.rightTop.x - widthOffset) / tilesize);

			if (a <= -1 || a > collisionArray.length) {
				a = 0;
			}

			if (b <= -1 || b > collisionArray[a].length) {
				b = 0;
			}

			if (collisionArray[a][b]) {
				moves.rightmove = false;
			}

			a = ~~((playerCollisionPoints.topLeft.y - heightOffset) / tilesize);
			b = ~~((playerCollisionPoints.topLeft.x - widthOffset) / tilesize);

			if (a <= -1 || a > collisionArray.length) {
				a = 0;
				moves.nextmapup = true;
			}

			if (b <= -1 || b > collisionArray[a].length) {
				b = 0;
			}

			if (collisionArray[a][b] && this.isBottom(collisionArray, a, b)) {
				moves.upmove = false;
			}

			a = ~~((playerCollisionPoints.topRight.y - heightOffset) / tilesize);
			b = ~~((playerCollisionPoints.topRight.x - widthOffset) / tilesize);

			if (a <= -1 || a > collisionArray.length) {
				a = 0;
			}

			if (b <= -1 || b > collisionArray[a].length) {
				b = 0;
			}

			if (collisionArray[a][b] && this.isBottom(collisionArray, a, b)) {
				moves.upmove = false;
			}
		} catch (error) {
			moves = {
				leftmove: false,
				downmove: false,
				rightmove: false,
				upmove: false,
				nextmap: true,
				nextmapup: false
			};
		}

		return moves;
	};

	/**
	 * [checkDownCollisions description]
	 * @param  {[type]} playerCollisionPoints [description]
	 * @param  {[type]} collisionArray        [description]
	 * @param  {[type]} heightOffset          [description]
	 * @param  {[type]} widthOffset           [description]
	 * @return {[type]}                       [description]
	 */
	this.checkDownCollisions = function(playerCollisionPoints, collisionArray, heightOffset, widthOffset) {

		var moves = {
			leftmove: true,
			downmove: true,
			rightmove: true,
			upmove: true,
			nextmap: false,
			nextmapup: false
		};
		var tilesize = 16; // this is used as width and height!

		try {
			var a = ~~((playerCollisionPoints.bottomLeft.y - heightOffset) / tilesize);
			var b = ~~((playerCollisionPoints.bottomLeft.x - widthOffset) / tilesize);

			if (a <= -1 || a > collisionArray.length) {
				a = 0;
			}

			if (b <= -1 || b > collisionArray[a].length) {
				b = 0;
			}

			if (collisionArray[a][b] && this.isTop(collisionArray, a, b)) {
				moves.downmove = false;
			}

			a = ~~((playerCollisionPoints.bottomRight.y - heightOffset) / tilesize);
			b = ~~((playerCollisionPoints.bottomRight.x - widthOffset) / tilesize);

			if (a <= -1 || a > collisionArray.length) {
				a = 0;
			}

			if (b <= -1 || b > collisionArray[a].length) {
				b = 0;
			}

			if (collisionArray[a][b] && this.isTop(collisionArray, a, b)) {
				moves.downmove = false;
			}
		} catch (error) {
			moves = {
				leftmove: false,
				downmove: false,
				rightmove: false,
				upmove: false,
				nextmap: true,
				nextmapup: false
			};
		}

		return moves;
	};

	/**
	 * [isTop description]
	 * @param  {[type]}  collisionArray [description]
	 * @param  {[type]}  a              [description]
	 * @param  {[type]}  b              [description]
	 * @return {Boolean}                [description]
	 */
	this.isTop = function(collisionArray, a, b) {
		if (collisionArray[a - 1][b]) {
			return false;
		}

		return true;
	};

	/**
	 * [isBottom description]
	 * @param  {[type]}  collisionArray [description]
	 * @param  {[type]}  a              [description]
	 * @param  {[type]}  b              [description]
	 * @return {Boolean}                [description]
	 */
	this.isBottom = function(collisionArray, a, b) {
		if (collisionArray[a + 1][b]) {
			return false;
		}

		return true;
	};
}
