/**
 * [init description]
 * @return {[type]} [description]
 */
function init() {
	initVars();
	if (getParameterByName("level") === "0") {
		maps = wastemanmaps;
		beginGame(true);
	} else if (getParameterByName("level") === "1") {
		maps = accountingmanmaps;
		beginGame(true);
	}  else if (getParameterByName("level") === "8") {
		maps = visionarymanmaps;
		beginGame(true);
	} else {
		initTitleScreen();
	}
}

