/**
 * [Beam description]
 * @param {[type]} stage          [description]
 * @param {[type]} basicCollision [description]
 * @param {[type]} x              [description]
 * @param {[type]} y              [description]
 * @param {[type]} xspeed         [description]
 * @param {[type]} yspeed         [description]
 */
function Beam(stage, basicCollision, x, y, xspeed, yspeed) {
	var platformSpriteSheet = new createjs.SpriteSheet({
		"images": [loader.getResult("beam")],
		"frames": {
			"width": 16,
			"height": 16,
			"count": 2
		},
		"animations": {
			"still": {
				"frames": [0, 1],
				"next": "still",
				"speed": 0.0615
			}
		}
	}); // new createjs.Bitmap("images/businessmanspritesheet.png");


	this.damage = 0;
	this.basicCollision = basicCollision;
	this.stage = stage;
	this.animations = new createjs.Sprite(platformSpriteSheet, "still");
	this.x = x + parseInt(renderer.mapData.properties.stitchx); // - 32;
	this.y = y;
	this.xspeed = xspeed;
	this.lastx = x;
	this.lasty = y;
	this.yspeed = yspeed;
	this.activated = false;
	this.hardshell = true;
	this.goingup = false;
	this.goingright = false;
	this.watchedElements = [];
	this.animations.x = x - renderer.completedMapsWidthOffset;
	this.animations.y = this.y;

	this.animations.play();
	this.stage.addChild(this.animations);
	this.animations.visible = true;

	/**
	 * [tickActions description]
	 * @return {[type]} [description]
	 */
	this.tickActions = function() {
		if (this.xspeed < 0 && this.x < 0) {
			this.x = renderer.getMapWidth() + renderer.completedMapsWidthOffset;
			this.lastx = this.x;
			this.animations.x = this.x - renderer.completedMapsWidthOffset;
		}

		if (this.yspeed < 0 && this.y < 0) {
			this.y = renderer.getMapHeight();
			this.lasty = this.y;
			this.animations.y = this.y;
		}

		if (this.xspeed > 0 && this.x > renderer.getMapWidth() + renderer.completedMapsWidthOffset) {
			this.x = renderer.completedMapsWidthOffset;
			this.lastx = this.x;
			this.animations.x = this.x - renderer.completedMapsWidthOffset;
		}

		if (this.yspeed > 0 && this.y > renderer.getMapHeight()) {
			this.y = 0;
			this.lastx = this.y;
			this.animations.y = this.y;
		}

		this.y += this.yspeed;
		this.animations.y += this.y - this.lasty;

		this.x += this.xspeed;
		this.animations.x += this.x - this.lastx;

		this.lasty = this.y;
		this.lastx = this.x;
	};

	/**
	 * [playerCollisionActions description]
	 * @return {[type]} [description]
	 */
	this.playerCollisionActions = function() {

	};
}
/**
 * [BigHealth description]
 * @param {[type]} stage          [description]
 * @param {[type]} x              [description]
 * @param {[type]} y              [description]
 * @param {[type]} basicCollision [description]
 */
function BigHealth(stage, x, y, basicCollision) {
	var bigHealthSpriteSheet = new createjs.SpriteSheet({
		"images": [loader.getResult("bighealth")],
		"frames": {
			"width": 12,
			"height": 12,
			"count": 2
		},
		"animations": {
			"blink": {
				"frames": [0, 0, 1, 1, 1, 1],
				"next": "blink",
				"speed": (0.125) / skipFrames
			}
		}
	}); // new createjs.Bitmap("images/businessmanspritesheet.png");

	this.stage = stage;
	this.animations = new createjs.Sprite(bigHealthSpriteSheet, "blink");
	this.x = x + parseInt(renderer.mapData.properties.stitchx); // - 32;
	this.y = y;
	this.activated = false;
	this.jumping = false;
	this.jumpspeed = 0;
	this.damage = -10;
	this.health = 1;
	this.basicCollision = basicCollision;
	this.hardshell = false;
	this.movementTicks = 0;
	this.watchedElements = [];
	this.animations.x = this.x - renderer.completedMapsWidthOffset;
	this.animations.y = this.y;

	this.animations.play();
	this.stage.addChild(this.animations);

	/**
	 * [tickActions description]
	 * @return {[type]} [description]
	 */
	this.tickActions = function() {
		this.watchedElements.forEach(function(element) {
			element.tickActions(actions);
		});

		if (this.activated) {
			return;
		}

		if (this.health < 0) {
			this.stage.removeChild(this.animations);
			playSoundTwice("health");
			this.activated = true;
		}

		var collisionResults = this.basicCollision.basicCollision(this);
		if (collisionResults.down && !this.jumping) {
			this.jumpspeed = 0;
			this.jumping = true;
		}

		if (this.jumping && collisionResults.down) {
			this.jumpspeed += 0.25;
			if (this.jumpspeed > 12) {
				this.jumpspeed = 12;
			}

			this.y += this.jumpspeed;
		}

		if (!collisionResults.down && this.jumping) {
			this.jumping = false;
			this.jumpspeed = 0;
		}

		if (!collisionResults.down) {
			this.y -= (this.y + this.animations.spriteSheet._frameHeight) & 15; // (numerator % divisor) === (numerator & (divisor - 1)); and we're doing: spriteSheet._frameHeight) % 16;
		}

		this.animations.x = this.x - renderer.completedMapsWidthOffset;
		this.animations.y = this.y;
	};
}
/**
 * [BossHealthBar description]
 * @param {[type]} stage [description]
 * @param {[type]} boss  [description]
 */
var BossHealthBar = function(stage, boss) {
	this.maxheight = 14 * 4 + 1; // 28 bars taking 2px each vertically
	this.stage = stage;
	this.boss = boss;
	this.bars = 28;
	this.x = renderer.gamestage.canvas.width - 36;
	this.y = 48; //this.stage.canvas.height / 2 - this.maxheight / 2 - 2;
	this.barAnimations = [];

	/**
	 * [tickActions description]
	 * @return {[type]} [description]
	 */
	this.tickActions = function() {
		if (this.bars !== this.boss.health) {
			this.bars = this.boss.health;
			this.draw();
		}
	};

	/**
	 * [draw description]
	 * @return {[type]} [description]
	 */
	this.draw = function() {
		console.log("drawing boss health bar!");
		var box = new createjs.Shape();
		box.graphics.beginFill("#000000").drawRect(this.x, this.y, 8, this.maxheight);

		this.stage.addChild(box);

		for (var i = 0; i < this.barAnimations.length; i++) {
			this.stage.removeChild(this.barAnimations[i]);
		}
		this.barAnimations.length = 0;

		var offset = (28 - this.bars) * 2;
		for (i = 0; i < this.bars; i++) {
			var barItem = new createjs.Bitmap("resources/images/bosshealthbar.png");
			barItem.x = renderer.gamestage.canvas.width - 35;
			barItem.y = i * 2 + offset + this.y + 1;
			this.barAnimations.push(barItem);
			this.stage.addChild(barItem);
		}
	};

	setTimeout(function() {
		this.draw();
	}.bind(this), 250);
};
