	this.x = x + parseInt(renderer.mapData.properties.stitchx); // - 32;
	this.y = y;
	this.xspeed = xspeed;
	this.lastx = x + parseInt(renderer.mapData.properties.stitchx);
	this.lasty = y;
	this.yspeed = yspeed;
